import React,{useState,useEffect} from 'react'


const Contacts = () =>{
const [contacts , setContacts] = useState([{id:1,name:'Igor',number:'3434534534'},{id:1,name:'Igor',number:'3434534534'},{id:1,name:'Igor',number:'3434534534'},{id:1,name:'Igor',number:'3434534534'}])
return (
	<div>
	{contacts.map(el=>{
		<p>el.id</p>
	})}
	</div>)
}
export default Contacts
